  [],\n\t\"num_tags\": 0,\n\t\"name\": \"ocean-current-data-measured-by-the-acoustic-doppler-current-profiler-adcp-aboard-the-developmen\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Ocean current data were collected by ADCP
  aboard the Discoverer Enterprise in the Gulf of Mexico in response to the Deepwater
  Horizon oil spill event on April 20, 2010. The Development Driller III (DD3) semisubmersible
  drilling rig was deployed to the site of the Deepwater Horizon Oil Spill incident
  to assist in the drilling of a relief well. This record is a summary of ADCP data
  that the Development Driller III collected from May 31, 2010 to July 04, 2010. The
  data from this ADCP is raw and unprocessed. Some of the datasets associated with
  this instrument are still incomplete and will be published as they become available.\",\n\t\"owner_org\":
